import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import logo from '../assets/images/logo.jpg';

function MyNavbar() {
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand src={logo} href="#home"></Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="#community">커뮤니티</Nav.Link>
          <Nav.Link href="#reviews">이용후기보기</Nav.Link>
          <Nav.Link href="#about">페이지소개</Nav.Link>
          <Nav.Link href="#custom-course">나만의 코스 만들기</Nav.Link>
          <Nav.Link href="#help">도움말/지원</Nav.Link>
        </Nav>
      </Navbar.Collapse>
      <Navbar.Collapse id="">
      <Nav.Link href="#login">로그인/회원가입</Nav.Link>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default MyNavbar;
